class MainTest(unittest.TestCase):
  def setUp( self ):    
    self.acc = ClassDict()
    self.acc.testdata = TestData()
    self.acc.testdata.init( None )
    self.acc.partydata = PartyData()
    self.acc.partydata.init( None )
    self.json = ''

    
  def apply( self ):
    if self.json:
      ModelChangeApplicator.apply( self.acc, "testdata", TestData, json_loads(self.json))


  def applyPD( self ):
    if self.json:
      ModelChangeApplicator.apply( self.acc, "partydata", PartyData, json_loads(self.json))

    
  def tearDown( self ):
    data = self.acc.testdata.save()
    result = TestData()
    result.load( data )
    result.init( None )

    data2 = result.save()
    if data != data2:
      err(self._testMethodName)
    assert data == data2
    
  
