  def testNextGuidHack( self ):
    self.json = '[{"auto":[["KeeperVal","add",{"1":{"id":1}}],["KeeperVal/1","upd",{"intVal":1}],["setVal","add",{"1":1}]]}]'
    self.apply( )
    assert self.acc.testdata.setVal[1].id == 1
    assert self.acc.testdata.setVal[1].intVal == 1
    obj, obj_id = self.acc.testdata.newKeeperType()
    obj.intVal = 2
    self.acc.testdata.setVal.add(obj)
    assert self.acc.testdata.setVal[1].id == 1
    assert self.acc.testdata.setVal[1].intVal == 1
    assert self.acc.testdata.setVal[2].id == 2
    assert self.acc.testdata.setVal[2].intVal == 2
    assert len(self.acc.testdata.setVal) == 2
    obj, obj_id = self.acc.testdata.newKeeperType()
    obj.intVal = 3
    self.acc.testdata.setVal.add(obj)
    assert self.acc.testdata.setVal[1].id == 1
    assert self.acc.testdata.setVal[1].intVal == 1
    assert self.acc.testdata.setVal[2].id == 2
    assert self.acc.testdata.setVal[2].intVal == 2
    assert self.acc.testdata.setVal[3].id == 3
    assert self.acc.testdata.setVal[3].intVal == 3
    assert len(self.acc.testdata.setVal) == 3
    
