  def testSetAddToFriendsData( self ):
    self.acc.FriendsData = FriendsData()
    self.acc.FriendsData.init( None )
    json = '[{"auto":[["FriendsKeeper","add",{"91":{"id":91}}],["FriendsKeeper/91","upd",{"Status":2,"person_uid":91,"fraction":1,"photoUrl":"http://graph.facebook.com/100000082512606/picture?type=square","gender":2,"InMatchmaking":false,"online":true,"nickName":"zar","fame":0,"lastLoginTime":1341580987}],["myFriends","add",{"91":91}]]}]'
    ModelChangeApplicator.apply( self.acc, "FriendsData", FriendsData, json_loads(json))
    
    friend = self.acc.FriendsData.getFriendByID( 91 )    
    assert friend.id == 91
    assert friend.Status == 2
    assert friend.person_uid == 91
    assert friend.fraction == 1
    assert friend.photoUrl == 'http://graph.facebook.com/100000082512606/picture?type=square'
    assert friend.InMatchmaking == False
    assert friend.online == True
    assert friend.nickName == 'zar'
    assert friend.fame == 0
    assert friend.lastLoginTime == 1341580987
    
    assert self.acc.FriendsData.myFriends.get(91).id == 91

    
